Hack-Slash issue 18 The Case of the Killer and the Questing King

&quot;Cat Curio teams up with the self-styled King of Spies to track down his son's murderer: the elusive and brutal slasher known as the Catalog Killer. But as their hunt continues, Cat begins to suspect that the King is concealing mysteries of his own - mysteries that can only be solved by Cat Curio, Intrepid Girl Detective!&quot;

Next issue 24th oct
